import videodatadet from './assets/Data/video-details.json';
function NextVideos(props){//or {handleclickVideo}

   const v = props.videos.map((video)=>{
        return(
            <div key={video.id} className="nextvideo" onClick={(event)=>{
                props.handleClickVideo(video)
            }}>
                <img className="" src={video.image} alt="video2"></img>
                <h1>{video.title}</h1>
                <h3>{video.uploader}</h3>
            </div>
        )
   })
    return(
       <div className="nextvideos">
            <h2 className="nextvideos__title">NEXT VIDEOS</h2>
            {v}
       </div>
    );
}
export default NextVideos;
